import React from 'react';
import SearchIcon from '@material-ui/icons/Search';

import { Avatar } from '@material-ui/core';
import "./Chat.css";

function Chat() {
    return (
        <div className="chat">
       <div class="chat__header">
      <Avatar/>
      <div class="chat__headerInfo">
        <h3>Room name</h3>
        <p>Last seen at...</p>
      </div>
    <div class="chat__headerRight">
    <IconButton>
      <DonutLargeIcon/>
      </IconButton>
      <IconButton>
      <ChatIcon/>
      </IconButton>
      <IconButton>
      <MoreVertIcon/>
      </IconButton>
      </div>
       </div>
        </div>
    )
}

export default Chat;
